export default function Footer() {


  return (
    <div className="footer">

        <div className="container">
                
                <div className="info">

                    <img src="https://i.imgur.com/4cHixEY.png" alt="" />
                    <span> - GitHub.com/CineraM </span>
                </div>
        </div>

    </div>
  )
}
